import { useEffect, useState } from 'react';
import './App.css';
import ArtistList from './components/ArtistList.js';
import AlbumList from './components/AlbumList.js';
import GenreList from './components/GenreList.js';


function App() {

    const [page, setPage] = useState(1);
    const [where, setWhere] = useState(1);

    function prevPage() {
        if (page === 1) {
            return;
        }
        setPage(page - 1);
    }

    function nextPage() {
        setPage(page + 1);
    }

    function changePage(where){
        switch(where) {
            case 'homepage':
              return <div>Option 1 selected</div>;
            case 'artists':
              return <div>Option 2 selected</div>;
            case 'albums':
                return <div>Option 2 selected</div>;
            case 'genres':
            return <div>Option 2 selected</div>;
        }
    }

    return (
        <>
            <div class="navbar">
                <li><button class="nav-links" onClick={()=>{changePage('homepage')}}>HOMEPAGE</button></li>
                <li><button class="nav-links" onClick={()=>{changePage('artists')}}>ARTISTS</button></li>
                <li><button class="nav-links" onClick={()=>{changePage('albums')}}>ALBUMS</button></li>
                <li><button class="nav-links" onClick={()=>{changePage('genres')}}>GENRES</button></li>
            </div>

            {/* <div>Artists</div> */}
            {/* {
                artist_list.map((artist) => {
                    return <ArtistList artist_name={artist['name']}  key={artist['id']} />;
                })
            } */}
            <div className='pageDiv'>
              <button className='pageButton' onClick={prevPage}>Previous Page</button>
              <p>Page {page}</p>
              <button className='pageButton' onClick={nextPage}>Next page</button>
            </div>
        </>
    );
}

export default App;
